// src/components/BannerCarousel.js
import React from 'react';
import Slider from 'react-slick';
import { Box, CardMedia } from '@mui/material';
import banner1 from '../assets/WhatsApp Image 2024-11-15 at 8.28.08 PM.jpeg'

const images = [
  {banner1}
];

const BannerCarousel = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 3000,
  };

  return (
    <Box sx={{ width: '80%', margin: '0 auto', mt: 3 }}>
      <Slider {...settings}>
        {images.map((image, index) => (
          <div key={index}>
            <CardMedia
              component="img"
              height="400"
              image={image}
              alt={`Banner ${index + 1}`}
              sx={{ objectFit: 'cover', borderRadius: 2 }}
            />
          </div>
        ))}
      </Slider>
    </Box>
  );
};

export default BannerCarousel;
